import React from 'react'
import { Switch, Route } from 'react-router';
import Navigation from './Dashboard/Navigation';
import Signup from './Dashboard/Signup';

function Admin() {
    return (
        <div>
            <Navigation />
            <center>
                <h3>Admin Page</h3>
            </center>
            <Switch>
                <Route path="/Admin/Signup" component={Signup} />
            </Switch>
        </div>
    )
}

export default Admin
